<div class="slide" name="slide" id="slideslideIface2"><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="10in" height="7.5in" class="slides-canvas" pointer-events="none" viewBox="0 0 720 540">
  <g text-rendering="geometricPrecision" pointer-events="painted" transform="scale(1, 1)">
    <rect x="0" y="0" width="720" height="540" fill="#FFFFFF" />
    <g transform="matrix(1, 0, 0, 1, 43.2000122, 129.599991)"><text font-family="Arial" font-style="normal" font-weight="normal" font-stretch="normal" font-size="22.875pt" fill="#000000" x="27" y="310.464"><tspan x="0" y="22.464">â¢</tspan><tspan x="27.05" y="22.464" font-family="Calibri" font-stretch="normal" font-size="22.5pt">GroupDocs was founded in 2010. We noticed</tspan><tspan xml:space="preserve" x="575.6262" y="22.464" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="51.264" font-family="Calibri" font-stretch="normal" font-size="22.5pt">there was a gap in the market for an easy to use,</tspan><tspan xml:space="preserve" x="616.2432" y="51.264" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="80.064" font-family="Calibri" font-stretch="normal" font-size="22.5pt">comprehensive online document management</tspan><tspan xml:space="preserve" x="595.2568" y="80.064" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="108.864" font-family="Calibri" font-stretch="normal" font-size="22.5pt">solution. Our goal is to make the lives of people</tspan><tspan xml:space="preserve" x="604.6172" y="108.864" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="137.664" font-family="Calibri" font-stretch="normal" font-size="22.5pt">who work with documents easier by giving them</tspan><tspan xml:space="preserve" x="617.1719" y="137.664" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="166.464" font-family="Calibri" font-stretch="normal" font-size="22.5pt">tools that save them time and effort. Our users</tspan><tspan xml:space="preserve" x="597.0635" y="166.464" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="195.264" font-family="Calibri" font-stretch="normal" font-size="22.5pt">are busy people who have a lot to do. Document</tspan><tspan xml:space="preserve" x="617.3252" y="195.264" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="224.064" font-family="Calibri" font-stretch="normal" font-size="22.5pt">management â whether itâs gathering signatures,</tspan><tspan xml:space="preserve" x="623.8867" y="224.064" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="252.864" font-family="Calibri" font-stretch="normal" font-size="22.5pt">posting documents on websites or collaborating</tspan><tspan xml:space="preserve" x="610.0098" y="252.864" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="281.664" font-family="Calibri" font-stretch="normal" font-size="22.5pt">with others to improve a text â should be easy.</tspan><tspan xml:space="preserve" x="594.8281" y="281.664" font-family="Calibri" font-stretch="normal" font-size="22.5pt"> </tspan><tspan x="27" y="310.464" font-family="Calibri" font-stretch="normal" font-size="22.5pt">This is our vision - Work faster, together.</tspan></text></g>
  </g>
</svg></div></body>
