<div class="slide" name="slide" id="slideslideIface3"><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="10in" height="7.5in" class="slides-canvas" pointer-events="none" viewBox="0 0 720 540">
