    <g transform="matrix(1, 0, 0, 1, 43.2000122, 129.599991)">
      <path fill="#0000FF" d="M393.64 340.24L452.84 340.24 452.84 342.16 393.64 342.16z" /><text font-family="Arial" font-style="normal" font-weight="normal" font-stretch="normal" font-size="24.375pt" fill="#000000" x="27" y="337.9968"><tspan x="0" y="26.9568">â¢</tspan><tspan x="27.05" y="26.9568" font-family="Calibri" font-stretch="normal" font-size="24pt">The GroupDocs vision is of a world where</tspan><tspan xml:space="preserve" x="563.9406" y="26.9568" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="61.5168" font-family="Calibri" font-stretch="normal" font-size="24pt">people everywhere can collaborate and share</tspan><tspan xml:space="preserve" x="617.6406" y="61.5168" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="96.07681" font-family="Calibri" font-stretch="normal" font-size="24pt">documents seamlessly, regardless of the</tspan><tspan xml:space="preserve" x="548.0938" y="96.07681" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="130.6368" font-family="Calibri" font-stretch="normal" font-size="24pt">operating systems or programs they have. The</tspan><tspan xml:space="preserve" x="624.75" y="130.6368" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="165.1968" font-family="Calibri" font-stretch="normal" font-size="24pt">solution is a cloud-based platform supported</tspan><tspan xml:space="preserve" x="608.3125" y="165.1968" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="199.7568" font-family="Calibri" font-stretch="normal" font-size="24pt">by tools that really speed up our usersâ</tspan><tspan xml:space="preserve" x="529.6406" y="199.7568" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="234.3168" font-family="Calibri" font-stretch="normal" font-size="24pt">productivity. As well as document storage, we</tspan><tspan xml:space="preserve" x="619.9219" y="234.3168" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="268.8768" font-family="Calibri" font-stretch="normal" font-size="24pt">offer an easy way to share, sign, assemble,</tspan><tspan xml:space="preserve" x="577.5" y="268.8768" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="303.4368" font-family="Calibri" font-stretch="normal" font-size="24pt">view, compare and collaborate on documents.</tspan><tspan xml:space="preserve" x="624.5469" y="303.4368" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><tspan x="27" y="337.9968" font-family="Calibri" font-stretch="normal" font-size="24pt">Read more about our vision</tspan><tspan xml:space="preserve" x="386.3906" y="337.9968" font-family="Calibri" font-stretch="normal" font-size="24pt"> </tspan><a xlink:href="http://groupdocs.com/corporate/vision"><tspan x="393.6406" y="337.9968" textLength="59.20313" font-family="Calibri" font-stretch="normal" font-size="24pt" fill="#0000FF">here</tspan></a></text></g>
  </g>
</svg></div></body>
