    <g transform="matrix(1, 0, 0, 1, 43.2000122, 129.599991)">
      <path fill="#0000FF" d="M287.77 152.96L435.8 152.96 435.8 154.88 287.77 154.88z" /><text font-family="Arial" font-style="normal" font-weight="normal" font-stretch="normal" font-size="19.125pt" fill="#000000" x="27" y="318.72"><tspan x="0" y="18.72">â¢</tspan><tspan x="27.05" y="18.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">GroupDocs is used by companies of all sizes across the</tspan><tspan xml:space="preserve" x="577.1032" y="18.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="42.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">globe, from large multinational firms to small freelance</tspan><tspan xml:space="preserve" x="585.6172" y="42.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="66.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">businesses. They come to us because they have a need for</tspan><tspan xml:space="preserve" x="616.8394" y="66.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="90.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">a simple, one-stop-shop, document management solution.</tspan><tspan x="0" y="120.72">â¢</tspan><tspan x="27.05" y="120.72" font-weight="bold" font-family="Calibri" font-stretch="normal" font-size="18.75pt">Our Background</tspan><tspan x="0" y="150.72">â¢</tspan><tspan x="27.05" y="150.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">GroupDocs is a division of</tspan><a xlink:href="http://www.aspose.com/"><tspan x="287.7722" y="150.72" textLength="148.0269" font-family="Calibri" font-stretch="normal" font-size="18.75pt" fill="#0000FF">Aspose Pty Ltd</tspan></a><tspan x="435.799" y="150.72" textLength="155.875" font-family="Calibri" font-stretch="normal" font-size="18.75pt">, a leading .NET</tspan><tspan xml:space="preserve" x="591.674" y="150.72" textLength="5.625" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="174.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">and Java component vendor. Aspose creates tools that</tspan><tspan xml:space="preserve" x="577.0894" y="174.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="198.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">software engineers use to work with file formats in the</tspan><tspan xml:space="preserve" x="582.3545" y="198.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="222.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">applications they build. Aspose has supported the</tspan><tspan xml:space="preserve" x="531.5083" y="222.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="246.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">developer community since 2002 and has over 10,000</tspan><tspan xml:space="preserve" x="573.9473" y="246.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="270.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">customers in over 90 countries. GroupDocs, benefits from</tspan><tspan xml:space="preserve" x="611.979" y="270.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="294.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">Aspose's experience, stability and award winning</tspan><tspan xml:space="preserve" x="522.6172" y="294.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt"> </tspan><tspan x="27" y="318.72" font-family="Calibri" font-stretch="normal" font-size="18.75pt">technology.</tspan></text></g>
